import React from "react";

const CardMoreProjects = (props) => {
  const { title, year, gpa, desc } = props;
  return (
    <>
      <section>
        <div className="box box_shadow">
          <div className="title_content d_flex">
            <div className="title">
              <h4>{title}</h4>
            </div>
            <div className="gpa">
              <button className="btn_shadow">View Project</button>
            </div>
          </div>
          <hr />
        </div>
      </section>
    </>
  );
};

export default CardMoreProjects;
